	module.exports = "<section class=\"tips\" id=\"laeringsmal\">\n<h1 class=\"tips\" id=\"laeringsmal\">Læringsmål</h1>\n<ul>\n<li>beskrive og gjennomføre spegling, rotasjon og parallellforskyving</li>\n<li>beskrive plassering og flytting i rutenett, på kart og i koordinatsystem, med og utan digitale hjelpemiddel, og bruke koordinatar til å berekne avstandar parallelt med aksane i eit koordinatsystem</li>\n</ul>\n</section>\n<section class=\"intro\" id=\"introduksjon\">\n<h1 class=\"intro\" id=\"introduksjon\">Introduksjon</h1>\n<p>I denne oppgaven skal vi importere en geometrisk figur og deretter <code class=\"blockmotion\">rotere</code> den.\nOBS! Har du allerede løst oppgaven med rotasjon rundt egen akse kan du hoppe over Steg 1 og heller bare laste inn den forrige oppgaven din fra &quot;Mine ting&quot;-mappen.</p>\n<figure><img src=\"" + __webpack_require__(/*! ../rotasjon/Geometri.png */ 1369) + "\" alt=\"\" /></figure>\n</section>\n<section class=\"activity\" id=\"steg-1-forberedelser\">\n<h1 class=\"activity\" id=\"steg-1-forberedelser\">Steg 1: Forberedelser</h1>\n<p><em>For å gjøre det enkelt å komme i gang, henter vi inn en ferdig figur fra biblioteket til Scratch.\nDenne figuren er tilnærmet lik en likebeint trekant</em></p>\n<section class=\"check\" id=\"sjekkliste\">\n<h2 class=\"check\" id=\"sjekkliste\">Sjekkliste</h2>\n<ul>\n<li>\n<p>Start et nytt prosjekt.</p>\n</li>\n<li>\n<figure>Slett kattefiguren ved å høyreklikke på den og velge <code>slett</code>.</figure>\n</li>\n<li>\n<p>Legg til en ny figur. Klikk på <img src=\"" + __webpack_require__(/*! ../bilder/hent-fra-bibliotek.png */ 1031) + "\" alt=\"Velg figur fra biblioteket\" />-knappen og velg trollmannshatten. Vi har brukt <code>Ting/Wizard Hat</code>-figuren.</p>\n</li>\n<li>\n<p>Gi den nye figuren navnet <code>Hattulf</code> ved å klikke på <code>i</code>.</p>\n</li>\n<li>\n<p>Før vi begynner med selve oppgaven, skal vi legge inn en liten hjelpefunksjon om noe uventet skulle skje:</p>\n<pre><code class=\"language-blocks\">når [n v] trykkes\nvis\npek i retning [<span class=\"hljs-number\">90</span> v]\ngå til x: (<span class=\"hljs-number\">0</span>) y: (<span class=\"hljs-number\">0</span>)\n</code></pre>\n</li>\n<li>\n<p>Skulle noe uventet skje nå, trenger du bare å trykke på tasten N på tastaturet, så vil Hattulf gå tilbake til utgangspunktet, slik at du kan prøve på nytt.</p>\n</li>\n</ul>\n</section>\n<section class=\"flag\" id=\"test-prosjektet\">\n<h2 class=\"flag\" id=\"test-prosjektet\">Test prosjektet</h2>\n<ul>\n<li>Bruk musepekeren og flytt Hattulf til et nytt sted i bildet.</li>\n<li>Trykk N på tastaturet ditt. Hopper Hattulf tilbake til midten av bildet? Hvis ja: Gå videre til steg 2. Hvis nei: Feilsøk koden din, fiks den, test på nytt.</li>\n</ul>\n</section>\n</section>\n<section class=\"activity\" id=\"steg-2-rotasjon-i-et-koordinatsystem\">\n<h1 class=\"activity\" id=\"steg-2-rotasjon-i-et-koordinatsystem\">Steg 2: Rotasjon i et koordinatsystem</h1>\n<ul>\n<li>\n<p>Importer bakgrunnen 'xy-grid'</p>\n</li>\n<li>\n<p>Velg Hattulf. I scriptet</p>\n<pre><code class=\"language-blocks\">når [n v] trykkes\nvis\npek i retning [<span class=\"hljs-number\">90</span> v]\ngå til x: (<span class=\"hljs-number\">0</span>) y: (<span class=\"hljs-number\">0</span>)\n</code></pre>\n</li>\n</ul>\n<p>endrer vi x-verdien til -100, og y-verdien til 100.</p>\n<ul>\n<li>Legg merke til punktet der x-aksen (vannrett) og y-aksen (loddrett) krysses. Det punktet kalles origo og er det stedet hvor både x = 0 og y = 0.</li>\n</ul>\n<section class=\"flag\" id=\"test-prosjektet-2\">\n<h2 class=\"flag\" id=\"test-prosjektet-2\">Test prosjektet</h2>\n<ul>\n<li>Trykk N på tastaturet. Hattulf skal havne akkurat der de to grå linjene for X = -100 og Y = 100 krysses.</li>\n<li>Hvis alt ser greit ut, fortsett til neste steg.</li>\n<li>Hvis noe ikke ser riktig ut, prøv å finne ut om du har gjort en feil i koden din og prøv å trykke N på nytt.</li>\n</ul>\n</section>\n</section>\n<section class=\"activity\" id=\"steg-3-hattulf-roteres-rundt-origo\">\n<h1 class=\"activity\" id=\"steg-3-hattulf-roteres-rundt-origo\">Steg 3: Hattulf roteres rundt origo</h1>\n<p>Nå skal vi altså rotere Hattulf rundt origo på en ganske enkel måte.</p>\n<ul>\n<li>\n<p>Lag dette skriptet til Hattulf:</p>\n<pre><code class=\"language-blocks\"><span class=\"hljs-keyword\">n</span>år [pil <span class=\"hljs-keyword\">h</span>øyre v] trykkes\n<span class=\"hljs-keyword\">g</span>å (200) steg\nvend <span class=\"hljs-keyword\">h</span>øyre (90) grader\n</code></pre>\n</li>\n</ul>\n<section class=\"flag\" id=\"test-prosjektet-3\">\n<h2 class=\"flag\" id=\"test-prosjektet-3\">Test prosjektet</h2>\n<ul>\n<li>Trykk tasten &quot;pil høyre&quot; på tastaturet. Hva skjer? Fortsett til Hattulf er tilbake ved startpunktet sitt.</li>\n<li>Hvis du studerer koden vi nettopp laget til Hattulf, ser du at vi ber Hattulf gå 200 steg. Hvorfor må vi gå så langt?</li>\n<li>Prøv å endre på antall steg Hattulf tar. Ender Hattulf opp på samme sted som han startet etter at du har trykket &quot;pil høyre&quot; fire ganger?</li>\n</ul>\n</section>\n</section>\n<section class=\"activity\" id=\"steg-4-en-ny-venn\">\n<h1 class=\"activity\" id=\"steg-4-en-ny-venn\">Steg 4: En ny venn!</h1>\n<ul>\n<li>\n<p>Legg til en ny figur. Denne gangen skal du få velge figur selv. Hvis den blir veldig stor i forhold til alt det andre, kan du krympe den ned til en passelig størrelse. Kall den nye figuren for &quot;Venn&quot;</p>\n</li>\n<li>\n<p>Lag en kopi av &quot;Når N trykkes&quot;-skriptet fra Hattulf til Venn, men endre y-verdien til 50.</p>\n</li>\n<li>\n<p>Kopier også over &quot;Når pil høyre trykkes&quot;-skriptet fra Hattulf, men halver både antall steg og antall grader i skriptet.</p>\n</li>\n<li>\n<figure>For litt mer moro kan du legge til en linje med kode som skrur på <code class=\"blockpen\">pennen</code> for begge figurene. Øverste del av pil høyre-skriptet skal da se slik ut:</figure>\n<pre><code class=\"language-blocks\"><span class=\"hljs-keyword\">n</span>år [pil <span class=\"hljs-keyword\">h</span>øyre v] trykkes\npenn på\n</code></pre>\n</li>\n</ul>\n<section class=\"flag\" id=\"test-prosjektet-4\">\n<h2 class=\"flag\" id=\"test-prosjektet-4\">Test prosjektet</h2>\n<ul>\n<li>Trykk pil høyre. Hva skjer?</li>\n<li>Trykk pil høyre slik at Hattulf kommer tilbake til utgangspunktet. Hvor langt har Venn kommet nå?</li>\n<li>Hvor mange ganger på du trykke for at Venn kommer tilbake til utgangspunktet?</li>\n<li>Klarer du å justere utgangspunktet til Venn, slik at figuren har like lang avstand til origo for hver gang du trykker pil høyre?</li>\n</ul>\n</section>\n</section>\n";

